  return (
    <div className="footer">
      <div className="container">
        <div className="imgW">MOVIESinfo</div>
        <div className="workproject">Дипломный проект</div>
        <div className="made"> </div>
        <div className="madename">Made by <br></br> Набережный Евгений</div>
      </div>
    </div>
  );
};

export default Footer;
